import tkinter as tk
from tkinter import messagebox, ttk
from PIL import Image, ImageTk
import csv
import os
import io
import base64

FICHIER = "mots_de_passe.csv"

# Image encod√©e en base64 (OURS)
image_base64 = """
 """

def enregistrer():
    site = entree_site.get()
    identifiant = entree_identifiant.get()
    mot_de_passe = entree_mdp.get()

    if not site or not identifiant or not mot_de_passe:
        messagebox.showerror("Erreur", "Tous les champs sont obligatoires.")
        return

    with open(FICHIER, "a", newline="", encoding="utf-8") as f:
        writer = csv.writer(f)
        writer.writerow([site, identifiant, mot_de_passe])

    entree_site.delete(0, tk.END)
    entree_identifiant.delete(0, tk.END)
    entree_mdp.delete(0, tk.END)
    afficher_mots_de_passe()

def afficher_mots_de_passe():
    for row in tree.get_children():
        tree.delete(row)

    if os.path.exists(FICHIER):
        with open(FICHIER, "r", encoding="utf-8") as f:
            reader = csv.reader(f)
            for ligne in reader:
                if len(ligne) == 3:
                    tree.insert("", tk.END, values=ligne)

# Fen√™tre principale
fenetre = tk.Tk()
fenetre.title("Gestionnaire de mots de passe")
fenetre.geometry("700x650")
fenetre.resizable(True, True)

# Image avec base64
image_bytes = base64.b64decode(image_base64)
image_stream = io.BytesIO(image_bytes)
image_ours = Image.open(image_stream)
image_ours = image_ours.resize((100, 100), Image.Resampling.LANCZOS)
photo_ours = ImageTk.PhotoImage(image_ours)
label_image = tk.Label(fenetre, image=photo_ours)
label_image.pack(pady=5)

# Texte "ORTHWEIN DIMITRI"
label_nom = tk.Label(fenetre, text="ORTHWEIN DIMITRI", font=("Arial", 10, "bold"))
label_nom.pack(pady=(0, 10))

# Champs d'entr√©e
tk.Label(fenetre, text="Site :").pack()
entree_site = tk.Entry(fenetre, width=40)
entree_site.pack()

tk.Label(fenetre, text="Identifiant :").pack()
entree_identifiant = tk.Entry(fenetre, width=40)
entree_identifiant.pack()

tk.Label(fenetre, text="Mot de passe :").pack()
entree_mdp = tk.Entry(fenetre, width=40, show="*")
entree_mdp.pack()

tk.Button(fenetre, text="Enregistrer", command=enregistrer).pack(pady=10)

# Tableau
tree = ttk.Treeview(fenetre, columns=("Site", "Identifiant", "Mot de passe"), show="headings")
tree.heading("Site", text="Site")
tree.heading("Identifiant", text="Identifiant")
tree.heading("Mot de passe", text="Mot de passe")
tree.pack(pady=10, expand=True, fill=tk.BOTH)

afficher_mots_de_passe()
fenetre.mainloop()
